    static getParsedObject(img: any, dataObject: Object[]): Object
    {
        var data: Object = { images: img, frames: [], animations: {} }
        var frames: number[][];
        var animations: Object;
        var animation: any[];
        var count: number = 0;
        var checkCount: number = 0;

        for (var i: number = 0; i < dataObject.length; i++)
        {
            frames = dataObject[i]['frames'];
            animations = dataObject[i]['animations'];

            checkCount = 0;
            for (var key in animations)
            {
                animation = animations[key];
                data['animations'][key] = animation;
                animation[0] = count;
                checkCount++;

                //console.log("[frames.len]", frames.length, key);
            }

            for (var j: number = 0; j < frames.length; j++)
            {
                data['frames'].push(frames[j]);
                count++;
            }
            animation[1] = count - 1;
        }

     //console.log("[getParsedObjectAnimation]", img, data);

        return data;
    }
